### 3.5 Herding Detection Strategies

Cross-Sectional Absolute Deviation (CSAD) model is one of the most well-known herding behavior detection approaches that has been used widely in many studies [20, 87, 92, 96, 120]. The fundamental idea of this technique is to examine the relationship between the average return (market return) of a set of assets and the dispersion across each asset return (CSAD). A herding signal is pronounced when the market return changes significantly (i.e. the market experiences large fluctuations, either going up or down) while the dispersion between asset returns decreases (i.e. the return movements of different assets become more similar). In this study, we use two forms of the CSAD model for our experiments.

$$
\begin{gathered}
C S A D_{t}=\beta_{0}+\beta_{1}\left|r_{m, t}\right|+\beta_{2} r_{m, t}^{2}+\epsilon_{t} \\
C S A D_{t}=\gamma_{0}+\gamma_{1} D^{u p}\left|r_{m, t}\right|+\gamma_{2} D^{u p} r_{m, t}^{2}+\gamma_{3} D^{d o w n}\left|r_{m, t}\right|+\gamma_{4} D^{d o w n} r_{m, t}^{2}+\zeta_{t}
\end{gathered}
$$

Where $C S A D_{t}=\sum_{k=1}^{T}\left|r_{i, t}-r_{m, t}\right| / T ; r_{i, t}$ is the return of asset $i$ at time $t ; r_{m, t}=\sum_{k=1}^{N} r_{k, t} / N$ is the average of asset returns (also known as the market return) at time $t ; \beta_{0}, \beta_{1}, \beta_{2}, \gamma_{0}, \gamma_{1}, \gamma_{2}, \gamma_{3}, \gamma_{4}$ are regression coefficients, $D^{u p}=1$ if $r_{m, t}$ is positive, otherwise $0 ; D^{d o w n}=1$ if $r_{m, t}$ is negative, otherwise $0 ; \epsilon_{t}, \zeta_{t}$ are error terms at time $t$.
Regarding Eq 3, a herding exists when the parameter $\beta_{2}$ is significantly negative (a negative coefficient with a confidence level of at least $90 \%$ ). Intuitively, we expect this coefficient to be negative because it follows the idea of the herding behavior, i.e. a dramatic increase or decrease in the market return $\left(r_{m, t}^{2}\right)$ coincides with a decline (negative $\beta_{2}$ ) in the dispersion between corresponding assets' returns $\left(C S A D_{t}\right)$. Eq 4 refers to a more detailed version of Eq 3 in which we separate the market condition into up (i.e. positive market return) and down (i.e. non-positive market return) so that the herding can be detected during the up and down market condition separately, instead of considering all market conditions (i.e. both up and down equally) as declared in the first form. The use of both forms for herding detection comes from an expectation that there might be periods when herding does not exist when considering both up and down market conditions at the same time but it might be found in the up or down market condition only. To this end, the

