# 3.6 Contagion Detection Strategy 

To capture the contagion effects between multiple time series, the Vector Autoregression (VAR) model has emerged as a foundational econometric tool. The VAR model, first introduced by Sims [121], is a statistical model that captures the linear interdependencies among multiple time series by allowing each variable to be regressed on lagged values of itself and other variables in the system [122]. Therefore, this model can identify bidirectional shock transmission between any two time series, capturing shocks moving from one series to the other and vice versa. Specifically, given a set of $k$ time series $\left\{y_{1}, y_{2}, \ldots, y_{k}\right\}$, the VAR model of order $p$ to assess the contagion effects between these $k$ time series can be expressed as:

$$
\left[\begin{array}{c}
y_{1, t} \\
y_{2, t} \\
\vdots \\
y_{k, t}
\end{array}\right]=\left[\begin{array}{c}
c_{1} \\
c_{2} \\
\vdots \\
c_{k}
\end{array}\right]+\left[\begin{array}{ccc}
a_{11}^{t-1} & \cdots & a_{1 k}^{t-1} \\
a_{21}^{t-1} & \cdots & a_{2 k}^{t-1} \\
\vdots & & \\
a_{k 1}^{t-1} & \cdots & a_{k k}^{t-1}
\end{array}\right]\left[\begin{array}{c}
y_{1, t-1} \\
y_{2, t-1} \\
\vdots \\
y_{k, t-1}
\end{array}\right]+\cdots+\left[\begin{array}{ccc}
a_{11}^{t-p} & \cdots & a_{1 k}^{t-p} \\
a_{21}^{t-p} & \cdots & a_{2 k}^{t-p} \\
\vdots & & \\
a_{k 1}^{t-p} & \cdots & a_{k k}^{t-p}
\end{array}\right]\left[\begin{array}{c}
y_{1, t-p} \\
y_{2, t-p} \\
\vdots \\
y_{k, t-p}
\end{array}\right]+\left[\begin{array}{c}
\varepsilon_{1} \\
\varepsilon_{2} \\
\vdots \\
\varepsilon_{k}
\end{array}\right]
$$

where $y_{i, t}$ is the value of time series $y_{i}$ at time $t ; p$ is the number of lagged values of each predictor time series used to predict the current value of a response time series. In other words, each time series in the system depends not only on its own past values up to $p$ time steps but also on the past values of all other time series in the system up to $p$ time

steps; $c_{i}$ is a regression coefficient for the corresponding equation of time series $y_{i} ; a_{i, j}^{t-z}$ is the contagion coefficient from $y_{j}$ to $y_{i}$ at lag $z$. A contagion effect from $y_{j}$ to $y_{i}$ at lag $z$ can be inferred if $a_{i, j}^{t-z}$ is statistically significant with a confidence level of at least $90 \%$. A positive coefficient means that an increase in one time series is associated with an increase in the other time series after a certain time and vice versa, a negative coefficient means that an increase in one time series is associated with a decrease in the other time series after a certain time and vice versa; $\epsilon_{i}$ is an error term for the corresponding equation of time series $y_{i}$.
